<div id="product_media"><div id="icon_box_header">PNG</div><div id="icon_box"><div id="nav_icon_box" style="padding-top: 10px;"><div class="icon_box_item"><a href="images/product_galleries/gfx-1086-01_01.jpg" class="lightview" rel="gallery[guigallery]"><img width="54" height="43" src="images/website/section_store/icon_images.gif" alt="Preview" /><br />Preview</a></div><a href="images/product_galleries/gfx-1086-01_02.jpg" class="lightview" rel="gallery[guigallery]"></a><a href="images/product_galleries/gfx-1086-01_03.jpg" class="lightview" rel="gallery[guigallery]"></a><a href="images/product_galleries/gfx-1086-01_04.jpg" class="lightview" rel="gallery[guigallery]"></a><a href="images/product_galleries/gfx-1086-01_05.jpg" class="lightview" rel="gallery[guigallery]"></a><a href="images/product_galleries/gfx-1086-01_06.jpg" class="lightview" rel="gallery[guigallery]"></a><a href="images/product_galleries/gfx-1086-01_07.jpg" class="lightview" rel="gallery[guigallery]"></a><div class="icon_box_item"><a href="/_literature_38007/gfx-1086-01_Glen-Ross_Sample"><img src="images/website/section_store/icon_demo.gif" width="54" height="43" alt="Sample"><br />Sample</a></div><div class="clear">&nbsp;</div></div></div></div><div id="product_body_left"><h4>Easy Start</h4> 
<p>Icons improve the user experience by speeding up visual recognition of interface functions as well as by adding curb appeal.</p> 
<h4>User Friendly</h4> 
<p>Novice and infrequent users find that icons make interface functions easier to learn and remember.</p> 
<h4>Programmer Friendly</h4> 
<p>Icons are provided as hi-res PNG images with transparency. Quickly batch-resize them using our <a href="/_product_61779/CoPilot">CoPilot software</a> for use in any of your projects.</p> 
<h4>Business Friendly</h4> 
<p>A quick, easy, and inexpensive way to simplify the end-user experience. Increase client satisfaction while reducing training time and long-term support needs. We design <a href="/services">bespoke icons</a> too.</p> 
<h5>Get it Now</h5> 
<p>Access downloads immediately. 24 hours a day, 7 days a week. We'll even store a backup for you.</p> 
<h5>P.S. Free Updates</h5> 
<p>We always provide free updates to our products. Please <a href="/contact">let us know</a> if you have any suggestions.</p></div><div id="product_body_right"><p>Glen-Ross is the ultimate icon collection. With 199 symbols in four different styles, it gives you nearly 800 icons to use in all your projects. A symbol by itself in a flat color lacks the luster that some GUI graphics really need. So our artists took 199 frequently used symbols and completely reinvented them to look right at home on modern touchscreens.</p><p>Whether you're working with a dark, light, minimal, or even a chaotic background, there's a style in this pack that has you covered. We've included blanks of all the orbs and all the plain symbols as 512x512 PNGs. Technically, that pushes the set to 997 icons ... but who's counting?</p><h4>Features &amp; Benefits</h4><ul><li>44 Sources (iPod, Security Camera, Jukebox, ...)</li><li>58 Transports (Play, Stop, Instant Replay, Thumbs up, ...)</li><li>61 Zones (Office, Theater, Garage, Living Room, ...)</li><li>36 Status Indicators (Locked/Unlocked, Lights On/Off, ...) </li></ul></div> 
